import { Link } from "react-router-dom";
import "./Home.css";

const Home = () => {
  return (
    <div className="home-container">
      {/* Navbar */}
      <nav className="navbar">
        <div className="logo">Helping Universe üåç</div>
        <div className="nav-links">
          <Link to="/login" className="btn">Login</Link>
          <Link to="/register" className="btn btn-primary">Register</Link>
        </div>
      </nav>

      {/* Hero Section */}
      <header className="hero">
        <h1>Welcome to Helping Universe</h1>
        <p>
          Together, we can make a difference! Support the needy by donating food,
          clothes, books, or funds.
        </p>
        <Link to="/donate" className="donate-btn">
          üíñ Donate Now
        </Link>
      </header>
    </div>
  );
};

export default Home;
